import * as GS from '../../styles/global';

export default function Callout() {
	return (
		<S.Call>
			<div>One</div>
			<div className="x">X</div>
			<div>Two</div>
			<div className="x">X</div>
			<div>Three</div>
		</S.Call>
	);
}
